import React, { useState, useEffect } from "react";
import { Form, Input } from "antd";
const formItemLayout = {
  labelCol: {
    xs: { span: 24 },
    sm: { span: 5 }
  },
  wrapperCol: {
    xs: { span: 24 },
    sm: { span: 12 }
  }
};
const edit01 = props => {
  useEffect(() => {
    console.log("MODAL !!", props);
  }, []);

  const { setEditVisible } = props;
  return (
    <>
      <button onClick={() => setEditVisible(false)}> 뒤로가기 </button>
      <Form {...formItemLayout}>
        <Form.Item label="E-mail">
          <Input disabled={true} />
        </Form.Item>
      </Form>
      {/* <Form>
        <Form.item label="abc">
          <Input disabled={false} />
        </Form.item>
      </Form> */}
    </>
  );
};

export default edit01;
